import React from 'react';
import Result from './Result';

function Results({results}){
    console.log({results})
    console.log({results}.length())
    if({results}==null){
        return(
            <span>Getting movies info, please wait...</span>
        )
    }
    else{
        return(
            <div class="movies">
                {results.map(result=>(
                    <Result key={result.name} result={result}/>
                ))}
            </div>
        )
    }
}

export default Results;
